import React from "react";
import { InputAdornment, withStyles, TextField } from "@material-ui/core";
import { Search } from "@material-ui/icons";
const styles = {
  root: {
    color: "inherit",
  },
};
const SearchBar = () => {
  return (
    <>
      <TextField
        variant="outlined"
        placeholder="Search..."
        InputProps={{
          endAdornment: (
            <InputAdornment>
              <Search />
            </InputAdornment>
          ),
        }}
      />
    </>
  );
};

export default withStyles(styles)(SearchBar);
